import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';
const Todo = (props) => {
    return (
       <div className="todo_style">
           <Button onClick={props.onSelect}>
                <DeleteIcon className="deleteIcon" />
           </Button>
           <li>{props.text}</li>
       </div>
    );
}

export default Todo;
